import React, {Component} from 'react';

class UngroupedItem extends Component {
    render() {
        const {content} = this.props;
        return (
            <li>
                <svg t="1639238384140" className="icon" viewBox="0 0 1024 1024" version="1.1"
                     xmlns="http://www.w3.org/2000/svg" p-id="2609" width="32" height="32">
                    <path
                        d="M512 0C228.430769 0 0 228.430769 0 512s228.430769 512 512 512 512-228.430769 512-512S795.569231 0 512 0z m0 945.230769C271.753846 945.230769 78.769231 752.246154 78.769231 512S271.753846 78.769231 512 78.769231s433.230769 192.984615 433.230769 433.230769-192.984615 433.230769-433.230769 433.230769z"
                        p-id="4618"></path>
                </svg>
                <svg t="1639238553272" className="icon" viewBox="0 0 1024 1024" version="1.1"
                     xmlns="http://www.w3.org/2000/svg" p-id="4617" width="95" height="95">


                </svg>
                <span>
                    {content}
                </span>
                <button
                    style={{display:'none'}}
                >
                    删除
                </button>
            </li>
        );
    }
}

export default UngroupedItem;
